Take a look at the following program. Can you guess what it prints to the console? class Main { public static void main(String[] args) { System.out.println("MLK said, "The time is always right to do what is right.""); }
} The syntax highlighting shows us that something is wrong. We can confirm this by trying to compile the program. The compiler complains about several errors (if you try compiling it yourself, notice that the compiler incorrectly identifies what the error is, so you need to identify and fix it yourself). In this case, the error is that we used a " in the text we were trying to print. The compiler thought that the " at the beginning of MLK's quote signified the end of the text we wanted to print. Then, it encountered a bunch of unknown words outside of quotations marks. It didn't know what to do, so it said there were several errors. We can get around this error by using escape sequences. These allow us to use special characters in text. The backslash character (\) indicates that we want to start an escape sequence. For instance, we can use \" in our text to print the " character. This means that the correct program to print MLK's quote looks like this: class Main { public static void main(String[] args) { System.out.println("MLK said, \"The time is always right to do what is right.\""); }
} If we want to manually insert a newline in a string of text, we can do so using the \n escape sequence. For instance, consider the following program: class Main { public static void main(String[] args) { System.out.println("This\nis\nsome\ntext."); }
} The output of the program looks like this: This
is
some
text. Using the \n escape sequence, you can mimic the behavior of the println statement using print. System.out.println("This is some text."); and System.out.print("This is some text.\n"); are equivalent. However, the println statement is preferred because it is more readable. To print the backslash character itself, you need to escape the backslash with another backslash. This means that to print \, you must use \\ inside your quotes. There are several other escape sequences in Java. You have learned the most important ones, but if you're curious, you can check out this website to learn the others.

